        }
  }

  CreateAccountClicked = () => {
        this.props.history.push('/registration')
  }

    render() {
        return (

            <>

                <Card className="mx-auto card-home-page">

                    <Card.Header>הרשמה</Card.Header>

                    <Card.Body>
                        <Card.Title>זה מהיר וקל</Card.Title>

                        < Button variant="success" size="lg" onClick={this.CreateAccountClicked} >צור חשבון</Button>

                    </Card.Body>

                    <Card.Footer className="text-muted">
                            בלחיצה על הרשמה, את/ה מסכים/מסכימה לתנאים, למדיניות בנושאי וקובצי עוגיות שלנו
                            ייתכן שתקבל/י התראות בהודעות טקסט מאיתנו ותוכל/י לבטל את הסכמתך
                            בכל עת</Card.Footer>
                    </Card>

            </>

        )
    }
}

export default HomePage
